import { createProxyMiddleware } from 'http-proxy-middleware';
export default createProxyMiddleware({
    target: "http://localhost:5000",
    headers:{
        'Accept': 'application/json',
        'Content-Type': 'application/json',
        'Access-Control-Allow-Origin': '*'
    }
});
